Probably also want a:

  "items": {
    "type": "number"
  }

  here as well

+1.  These look like devices that could be plugged into Yosemite, which I'm guessing based on some of them being called "CXL" (hard to know for sure based on names).

If these are things that are physically not on the yosemite baseboard, they need put into another file, which also implies that this schema needs changed to something like:

{
   "Type": "MCTPI2cDevice"
   "Address": "<address>"
   "Bus": "<bus>"
   "Name": MCTP_BRIDGE2

}


Then in the file for each add in card itself, there would be

{
    "Type": "MCTPEndpoint",
    "Id": 20
}
